import React from "react";
import {
  Button,
  Grid,
  List,
  ListItem,
  ListItemText,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Typography,
} from "@mui/material";
import FileUploadOutlinedIcon from "@mui/icons-material/FileUploadOutlined";

import "./userDash.css";
import NavBar from "./components/Navbar";

export default function UserDash() {
  return (
    <>
      {" "}
      <NavBar />
      <Grid
        container
        sx={{
          padding: "10em 7em 4em",
        }}
      >
        <Grid
          item
          width={"50%"}
          sx={{
            padding: "2em",
          }}
        >
          <div className="user_widget">
            <div className="upload_icon">
              <FileUploadOutlinedIcon
                fontSize="large"
                sx={{
                  fontSize: "4em",
                }}
              />
            </div>
          </div>
        </Grid>
        <Grid
          item
          width={"50%"}
          sx={{
            padding: "2em",
          }}
        >
          <div className="user_text">
            <Typography
              variant="h3"
              sx={{
                color: "#ffffff",
              }}
            >
              Upload a picture of a crop to get more info
            </Typography>
          </div>

          <div className="predict_btn">
            <Button
              variant="contained"
              size="large"
              sx={{
                color: "#ffffff",
                background: "#308335",
                padding: "1em",
              }}
            >
              CHECK
            </Button>
          </div>
        </Grid>
      </Grid>
    </>
  );
}
